import './Main.css'; // CSS import
import axios from 'axios';

function Main() {
  const [total, setTotal] = useState({
    schoolname : '',
    address : '',
    latitude : '',
    longitude : '',
  });

  const [tokn ,setTokn] = useState({
    latitude : '',
    longitude : '',
  })

   const t = (q)=>{
   setTokn({...tokn,[q.target.name] : q.target.value})
  }



  const tms = (q)=>{
   setTotal({...total,[q.target.name] : q.target.value})
  }
  const submit = async(e) => {    
    e.preventDefault();
    const st = await axios.post('http://localhost:5000/plus',total)
    console.log(st);
