    // const token = localStorage.getItem('token');

    const st = await axios.get('http://localhost:5000/gt/'
    //   {
    //     headers: {
    //     'Authorization': `Bearer ${token}`
    //   }
    // }
  )
    
    console.log(st);
    
  };

  return (
    <div className="login-container">

       <input
          type="text"
          placeholder="latitude..."
          name='latitude'
          onChange={t}
          className="login-input"
        />

          <input
          type="text"
          placeholder="longitude..."
          name='longitude'
          onChange={t}
          className="login-input"
        />


      <form className="login-form">
        <h2 className="login-heading">Login</h2>
        <input
          type="text"
          placeholder="schoolname..."
          name='schoolname'
          onChange={tms}
          className="login-input"
        />

         <input
          type="text"
          placeholder="address..."
          name='address'
          onChange={tms}
